script: |
  super -f text -I q6496.spq | sort > q6496.out

inputs:
  - name: q6496.spq
    data: |
      SELECT - - 51, - 24 - - 73 * - col1 col0, + + CAST ( NULL AS INTEGER ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + ( col1 ) BETWEEN + + col2 / - col1 AND NULL;
  - name: tab0

outputs:
  - name: q6496.out
    data: |
